if(jst.getDataSlotValue("ReturnStatus") == "1"){
	jst.putDataSlot("CallStatus", "Failure");
}else{
	jst.putDataSlot("CallStatus", "Closed");
	var irda = jst.getDataSlotValue("IrdaCommission");
	var finalStatus = jst.getDataSlotValue("FinalStatus");

	var blsession = blserver.connect("rgicl", "rgicl");
          var piId = jst.getProcessInstanceID();
          var wsName1 = "UWApprovalActivity";
          var wsName2 = "CUActivity";
          var wsi = blserver.getWorkStepInstance(blsession, piId, wsName1);
          var lst = wsi.getCompletedWorkItemPerformer();
          var prf1 = "";
          if(lst!=null && !lst.isEmpty()){ 
          prf1 = lst.get(lst.size()-1);
          }

          wsi = blserver.getWorkStepInstance(blsession, piId, wsName2);
          lst = wsi.getCompletedWorkItemPerformer();
          var prf2 = "";
          if(lst!=null && !lst.isEmpty()){ 
          prf2 = lst.get(lst.size()-1);
          }          

          var prf = "";          
	if(prf2 == "")
	{
	    prf = prf1;
	}
	else
	{
	    prf =  prf2;
	}

	if(irda>=0 && finalStatus=="Approved")
	{
	    var irdaStr = (new java.math.BigDecimal(irda)).toString();	    
	    obj.invokeWS(arr[1], irdaStr, prf);
	}	
}

